import React from "react";

import { Background, Heading, Night, ShootingStar } from "./styles";

const Landing = () => {
  return (
    <>
      <Background>
        <Heading>StarWars</Heading>
        <Night>
          <ShootingStar></ShootingStar>
          <ShootingStar></ShootingStar>
        </Night>
      </Background>
    </>
  );
};

export default Landing;
